import Layout from '../components/layout/layout'
import './index.scss'
const Index = () => {
    return (
        <Layout bgColor="#9ad3bc">
            <div className="login-form container">
                <h1>Đăng nhập</h1>
            </div>
        </Layout>
    )
}
export default Index;
